import axios from 'axios'
const getWeahter = (lat, lon) => {
    return new Promise((resolve, reject) => {
        axios.get(`localhost:3001/clima/temp?lat=${lat}&lon=${lon}`)
            .then(function (response) {
                // handle success
                resolve(response)
                console.log(response);
            })
            .catch(function (error) {
                // handle 
                reject(error)
                console.log(error);
            })
    })
}

module.exports = {getWeahter}
